import React from 'react'
import "../src/dist/styles.css";
import { Routes, Route } from "react-router-dom";
import Home from './pages/Home';

function App() {

  return (
        <Routes>
          <Route path="/" component={<Home />} />
          <Route path="/coins" component={<CoinPage />} />
        </Routes>
  );
}

export default App;
